import React from 'react';
import axios from 'axios';
import Timeslot from './Timeslot';

class Expanded extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            numberOfKills: null,
            shipSelected: 'Rattlesnake'
        };
    }
    componentDidMount = () => {
        axios.get(`/api/esi/${this.props.name}/${this.state.shipSelected}`)
            .then(response => {
                return this.setState({numberOfKills: response.data.parsedData})
            })
    };

    render(){
            return (
                <div>
                    <ul>
                        <h1>{this.props.name}</h1>
                        <Timeslot time = '00'/>
                        <Timeslot time = '01'/>
                        <Timeslot time = '02'/>
                        <Timeslot time = '03'/>
