                        <Timeslot time = '05'/>
                        <Timeslot time = '06'/>
                        <Timeslot time = '07'/>
                        <Timeslot time = '08'/>
                        <Timeslot time = '09'/>
                        <Timeslot time = '10'/>
                        <Timeslot time = '11'/>
                        <Timeslot time = '12'/>
                        <Timeslot time = '13'/>
                        <Timeslot time = '14'/>
                        <Timeslot time = '15'/>
                        <Timeslot time = '16'/>
                        <Timeslot time = '17'/>
                        <Timeslot time = '18'/>
                        <Timeslot time = '19'/>
                        <Timeslot time = '20'/>
                        <Timeslot time = '21'/>
                        <Timeslot time = '22'/>
                        <Timeslot time = '23'/>
                    </ul>
                </div>
            )
    }
};

export default Expanded;
